# --- Embedded Template Data ---
EMBEDDED_TEMPLATE_ZLIB = ""

def get_embedded_template():
    return zlib.decompress(base64.b64decode(EMBEDDED_TEMPLATE_ZLIB))

def get_template_data(search_dir=None):
    """
    Tries to load 'template.CR3' from search_dir.
    If not found or error, returns the embedded template.
    """
    if search_dir:
        template_path = os.path.join(search_dir, "template.CR3")
        if os.path.exists(template_path):
            try:
                print(f"Loading external template from: {template_path}")
                with open(template_path, "rb") as f:
                    return f.read()
            except Exception as e:
                print(f"Warning: Failed to read external template: {e}")
    
    print("Using embedded template.")
    return get_embedded_template()


# --- MP4/ISOBMFF Parsing Helpers ---

def read_box_header(f):
    header = f.read(8)
    if len(header) < 8:
        return None
    size, type_bytes = struct.unpack(">I4s", header)
    box_type = type_bytes.decode('ascii', errors='ignore')
    
    box_size = size
    header_len = 8
    
    if size == 1:
        large_size_data = f.read(8)
        if len(large_size_data) < 8:
            return None
        box_size = struct.unpack(">Q", large_size_data)[0]
        header_len += 8
        
    return box_size, box_type, header_len

def analyze_tracks(filepath):
    """
    Parses the CR3/MP4 file to find all tracks and their sample tables.
    Returns a list of dicts: [{'sizes': [], 'offsets': []}, ...]
    """
    tracks = [] 
    
    def walk_atoms(start, end, f):
        f.seek(start)
        while f.tell() < end:
            pos = f.tell()
            res = read_box_header(f)
            if not res: break
            size, btype, hlen = res
            yield pos, size, btype, hlen
            f.seek(pos + size)

    filesize = os.path.getsize(filepath)
    with open(filepath, 'rb') as f:
        # Find moov
        moov = None
        for pos, size, btype, hlen in walk_atoms(0, filesize, f):
            if btype == 'moov':
                moov = (pos, size, hlen)
                break
        
        if not moov:
            print(f"Error: No 'moov' atom found in {os.path.basename(filepath)}")
            return []
            
        # Inside moov, find traks
        moov_start = moov[0] + moov[2]
        moov_end = moov[0] + moov[1]
        
        for t_pos, t_size, t_type, t_hlen in walk_atoms(moov_start, moov_end, f):
            if t_type == 'trak':
                track_data = {'sizes': [], 'offsets': []}
                
                # Deep recursive search for stsz and stco/co64 within the trak atom
                def find_tables(start, end):
                    f.seek(start)
                    current_pos = start
                    while current_pos < end:
                        f.seek(current_pos)
                        res = read_box_header(f)
                        if not res: break
                        sz, bt, hl = res
                        
                        if bt == 'stsz':
                            f.seek(current_pos + hl)
                            data = f.read(12)
                            vf, us, count = struct.unpack(">III", data)
                            if us == 0:
                                track_data['sizes'] = [struct.unpack(">I", f.read(4))[0] for _ in range(count)]
                            else:
                                track_data['sizes'] = [us] * count
                        elif bt == 'co64':
                            f.seek(current_pos + hl)
                            vf, count = struct.unpack(">II", f.read(8))
                            track_data['offsets'] = [struct.unpack(">Q", f.read(8))[0] for _ in range(count)]
                        elif bt == 'stco':
                            f.seek(current_pos + hl)
                            vf, count = struct.unpack(">II", f.read(8))
                            track_data['offsets'] = [struct.unpack(">I", f.read(4))[0] for _ in range(count)]
                        elif bt in ['mdia', 'minf', 'stbl']:
                            find_tables(current_pos + hl, current_pos + sz)
                            
                        current_pos += sz
                        
                find_tables(t_pos + t_hlen, t_pos + t_size)
                tracks.append(track_data)
                
    return tracks

# --- Template Analysis for Reconstruction ---

def analyze_template_locations(data_or_path):
    """
    Analyzes the template CR3 to find the byte offsets of the STSZ and CO64 atoms
    that need to be patched.
    """
    locations = [] # List of dicts {stsz: offset, co64: offset, stco: offset}
    
    def walk(f, end_offset, current_track_fmt=None):
        while f.tell() < end_offset:
            pos = f.tell()
            header = f.read(8)
            if len(header) < 8: break
            size, type_bytes = struct.unpack(">I4s", header)
            btype = type_bytes.decode('ascii', errors='ignore')
            
            box_size = size
            if size == 1:
                size = struct.unpack(">Q", f.read(8))[0]
                
            if btype == 'trak':
                locations.append({'stsz': None, 'co64': None, 'stco': None})
                walk(f, pos + size, locations[-1])
            
            elif btype in ['moov', 'mdia', 'minf', 'stbl']:
                walk(f, pos + size, current_track_fmt)
                
            elif btype == 'stsz':
                # Version(1)+Flags(3) + UniformSize(4) + Count(4) -> Offset is at +12
                if current_track_fmt:
                    current_track_fmt['stsz'] = pos + 12
                    
            elif btype == 'co64':
                # Version(1)+Flags(3) + Count(4) -> Offset starts at +8
                # But typically we patch the FIRST offset. 
                # Wait, co64 structure is: VerFlags(4) + EntryCount(4) + Entries(8*Count).
                # We want to patch the first 8-byte entry. So pos + 8 + 8? No, header is 8 bytes.
                # Box Content starts at pos+8.
                # VerFlags(4) + Count(4) = 8 bytes.
                # So first entry is at pos + 8 (header) + 8 (body pre-amble) = pos + 16.
                if current_track_fmt:
                    current_track_fmt['co64'] = pos + 16
            
            elif btype == 'stco': 
                # Same logic, 32-bit entries. Pos + 16.
                 if current_track_fmt:
                    current_track_fmt['stco'] = pos + 16

            f.seek(pos + box_size)

    if isinstance(data_or_path, (bytes, bytearray)):
        f = io.BytesIO(data_or_path)
        try:
            f.seek(0, io.SEEK_END)
            size = f.tell()
            f.seek(0)
            walk(f, size)
        finally:
            f.close()
    else:
        with open(data_or_path, 'rb') as f:
            walk(f, os.path.getsize(data_or_path))
        
    return locations

def find_mdat(data_or_path):
    """
    Locates the 'mdat' atom to determine header size and mdat header structure.
    """
    def _search(f):
        while True:
            pos = f.tell()
            header = f.read(8)
            if len(header) < 8: break
            size, type_bytes = struct.unpack(">I4s", header)
            
            if type_bytes == b'mdat':
                 return pos, size, 8
            
            if size == 1:
                large_size = struct.unpack(">Q", f.read(8))[0]
                if type_bytes == b'mdat':
                    return pos, large_size, 16
                size = large_size # For skipping
            
            if size == 0: break 
            f.seek(pos + size)
        return None

    if isinstance(data_or_path, (bytes, bytearray)):
        f = io.BytesIO(data_or_path)
        try:
            return _search(f)
        finally:
            f.close()
    else:
        with open(data_or_path, 'rb') as f:
            return _search(f)

# --- Main Logic ---

def process_file(burst_file, template_data):
    print(f"\nProcessing Burst File: {os.path.basename(burst_file)}")
    
    # 1. Output Directory
    base_name = os.path.splitext(os.path.basename(burst_file))[0]
    output_dir = os.path.join(os.path.dirname(burst_file), base_name + "_extracted")
    if not os.path.exists(output_dir):
        os.makedirs(output_dir)
        print(f"Created output directory: {output_dir}")

    # 2. Analyze Burst Content
    tracks = analyze_tracks(burst_file)
    if not tracks:
        print("Failed to analyze tracks.")
        return

    # Check for expected tracks
    # Track 1: JPEGs
    # Track 3: RAWs
    jpeg_track = tracks[0] if len(tracks) >= 1 else None
    
    num_frames = len(tracks[0]['sizes']) if tracks else 0
    print(f"Found {len(tracks)} tracks. Detected {num_frames} frames.")

    # 3. Analyze Template for reconstruction
    patch_locs = analyze_template_locations(template_data)
    mdat_info = find_mdat(template_data)
    
    header_template = b""
    mdat_pos = 0
    mdat_header_len = 16 # Default to 64-bit mdat
    
    if mdat_info:
        mdat_pos, mdat_size, mdat_header_len = mdat_info
    else:
        # If no mdat found, assume the whole file is the header template
        # and we will append a new mdat atom.
        # print("Note: 'mdat' atom not found in template. Using entire template as header.")
        if isinstance(template_data, (bytes, bytearray)):
            mdat_pos = len(template_data)
        else:
            mdat_pos = os.path.getsize(template_data)

    # Load header template
    if isinstance(template_data, (bytes, bytearray)):
        header_template = template_data[:mdat_pos]
    else:
        with open(template_data, 'rb') as f:
            header_template = f.read(mdat_pos)

    # 4. Extraction Loop
    with open(burst_file, 'rb') as f_burst:
        for i in range(num_frames):
            print(f"  Frame {i+1}/{num_frames}...", end='\r')
            
            # --- Extract JPEG (Preview) ---
            if jpeg_track and i < len(jpeg_track['sizes']):
                size = jpeg_track['sizes'][i]
                offset = jpeg_track['offsets'][i]
                f_burst.seek(offset)
                jpeg_data = f_burst.read(size)
                
                # Check magic number
                ext = ".jpg" if jpeg_data.startswith(b'\xff\xd8') else ".bin"
                jpeg_name = os.path.join(output_dir, f"{base_name}_{i+1:02d}_preview{ext}")
                
                with open(jpeg_name, "wb") as out:
                    out.write(jpeg_data)

            # --- Reconstruct CR3 ---
            if header_template:
                # Gather all payloads for this frame across all tracks
                frame_payloads = []
                for track in tracks:
                    if i < len(track['sizes']):
                        size = track['sizes'][i]
                        offset = track['offsets'][i]
                        f_burst.seek(offset)
                        frame_payloads.append(f_burst.read(size))
                    else:
                        frame_payloads.append(b"")
                
                # Prepare new CR3 file
                cr3_name = os.path.join(output_dir, f"{base_name}_{i+1:02d}.CR3")
                new_header = bytearray(header_template)
                
                # mdat payload starts immediately after header + mdat atom header
                current_payload_offset = len(header_template) + mdat_header_len
                
                # Patch header with new sizes and offsets
                for t_idx, loc in enumerate(patch_locs):
                    if t_idx >= len(frame_payloads): break
                    payload_size = len(frame_payloads[t_idx])
                    
                    if loc['stsz']:
                        struct.pack_into(">I", new_header, loc['stsz'], payload_size)
                    
                    if loc['co64']:
                        struct.pack_into(">Q", new_header, loc['co64'], current_payload_offset)
                    elif loc['stco']:
                        struct.pack_into(">I", new_header, loc['stco'], current_payload_offset)
                    
                    current_payload_offset += payload_size
                
                # Write CR3
                with open(cr3_name, "wb") as f_out:
                    f_out.write(new_header)
                    
                    # Write mdat header
                    total_payload_size = sum(len(p) for p in frame_payloads)
                    if mdat_header_len == 16:
                         f_out.write(struct.pack(">I", 1))
                         f_out.write(b'mdat')
                         f_out.write(struct.pack(">Q", total_payload_size + 16))
                    else:
                         f_out.write(struct.pack(">I", total_payload_size + 8))
                         f_out.write(b'mdat')

                    # Write payloads
                    for p in frame_payloads:
                        f_out.write(p)

    print(f"\n  Done. Extracted to {output_dir}")

def gui_select_input():
    root = tk.Tk()
    root.withdraw() # Hide main window
    
    selection = {}
    
    def select_dir():
        path = filedialog.askdirectory(title="Slectionner un dossier contenant des fichiers CR3")
        if path:
            selection['type'] = 'dir'
            selection['path'] = path
            root.destroy()
            
    def select_file():
        path = filedialog.askopenfilename(title="Slectionner un fichier CR3", filetypes=[("Canon RAW 3", "*.CR3")])
        if path:
            selection['type'] = 'file'
            selection['path'] = path
            root.destroy()

    top = tk.Toplevel(root)
    top.title("Extraction Canon Burst")
    top.geometry("300x150")
    
    tk.Label(top, text="Que voulez-vous extraire ?").pack(pady=10)
    tk.Button(top, text="Tout un dossier", command=select_dir).pack(fill='x', padx=20, pady=5)
    tk.Button(top, text="Un fichier unique", command=select_file).pack(fill='x', padx=20, pady=5)
    
    top.protocol("WM_DELETE_WINDOW", root.destroy)
    
    # Position window in center of screen
    top.update_idletasks()
    width = top.winfo_width()
    height = top.winfo_height()
    x = (top.winfo_screenwidth() // 2) - (width // 2)
    y = (top.winfo_screenheight() // 2) - (height // 2)
    top.geometry('{}x{}+{}+{}'.format(width, height, x, y))
    
    root.wait_window(top)
    return selection.get('type'), selection.get('path')

def main():
    target_dir = None
    target_file = None

    if len(sys.argv) > 1:
        # Check if argument is a file or directory
        input_path = sys.argv[1]
        if os.path.isfile(input_path):
             target_file = input_path
        elif os.path.isdir(input_path):
             target_dir = input_path
        else:
             print(f"Invalid path: {input_path}")
             return
    else:
        # GUI Mode
        mode, path = gui_select_input()
        if not mode or not path:
            print("Aucune slection. Utilisation du dossier courant 'images' par dfaut.")
            target_dir = os.path.join(os.getcwd(), 'images')
            if not os.path.exists(target_dir):
                print(f"Dossier par dfaut non trouv: {target_dir}")
                return
        elif mode == 'file':
            target_file = path
        elif mode == 'dir':
            target_dir = path

    # Initialize Template
    # Try external template first, then internal
    if target_dir:
        template_data = get_template_data(target_dir)
    else:
        template_data = get_template_data(os.path.dirname(target_file))
        
    if not template_data:
        print("CRITICAL: Failed to load any template.")
        return
        
    if target_file:
         print(f"Single file mode: {target_file}")
         process_file(target_file, template_data)
    elif target_dir:
        files = glob.glob(os.path.join(target_dir, "*.CR3"))
        print(f"Found {len(files)} CR3 files in {target_dir}")
        for i, f in enumerate(files):
            print(f"\nProcessing Burst File ({i+1}/{len(files)}): {os.path.basename(f)}")
            process_file(f, template_data)
                
if __name__ == "__main__":
    try:
        main()
    except Exception as e:
        import traceback
        traceback.print_exc()
        print(f"\nUne erreur critique est survenue : {e}")
    finally:
        print("\n")
        input("Appuyez sur Entre pour quitter...")
